import * as faicons from "react icons/fa";

export const SidebarData = [
    {
        title:"Camera View",
        path:"/camera",
        icom: <faicons.Facam />,
    },
    {
        title:"Real Time Display",
        path:"/real-time",
        icom: <faicons.Facam />,
    },
    {
        title:"Record and Analysis",
        path:"/record",
        icom: <faicons.Facam />,
    },
    {
        title:"Account",
        path:"/account",
        icom: <faicons.Faaccount />,
    },
]
